            STYLES_INDEX.filter(styleIndex => {
              return styleIndex.urlRegex.test(window.location.href);
            })

            // Construct Style object
            .map(styleIndex => {
              return new Style({
                enabled: false,
                name: styleIndex.name,
                urlRegex: styleIndex.urlRegex,
                css: STYLES_CSS[styleIndex.name],
              });
            })

