        style.id = 'darkstyle-sheet-' + style.name;

        return {getName:getName, getID:getID, getURLRegex:getURLRegex, getCSS:getCSS, isEnabled:isEnabled, enable:enable, disable:disable, disableTemporarily:disableTemporarily, refresh:refresh};

